import React, { createContext, useContext, useMemo, useState } from 'react';
import { StyleSheet, TouchableOpacity, Text, View } from 'react-native';

// Elegant, muted palette
export const colors = {
  primary: '#1f3b57', // deep muted navy
  accent: '#9b6ef8', // muted lavender
  champagne: '#f7efe6', // soft warm surface
  background: '#f4f6f8',
  surface: '#ffffff',
  muted: '#eef2f7',
  text: '#0f1724',
  textMuted: '#6b7280',
  success: '#10b981',
  danger: '#ef4444'
};

const buildGlobal = (t) => StyleSheet.create({
  container: { flex: 1, padding: t.spacing.container || 20, backgroundColor: t.colors.background },
  card: { backgroundColor: t.colors.surface, borderRadius: 14, padding: t.spacing.card || 16, marginBottom: 12, shadowColor: '#102027', shadowOffset: { width: 0, height: 6 }, shadowOpacity: 0.06, shadowRadius: 10, elevation: 4 },
  elevatedCard: { backgroundColor: t.colors.surface, borderRadius: 16, padding: t.spacing.card || 18, marginBottom: 14, shadowColor: '#000', shadowOffset: { width: 0, height: 10 }, shadowOpacity: 0.08, shadowRadius: 18, elevation: 6 },
  header: { fontSize: 20, fontWeight: '800', color: t.colors.text, letterSpacing: 0.2 },
  subHeader: { fontSize: 16, fontWeight: '700', color: t.colors.text },
  subText: { fontSize: 13, color: t.colors.textMuted },
  smallText: { fontSize: 12, color: t.colors.textMuted },
  input: { borderWidth: 1, borderColor: t.colors.muted || '#e6e9ee', backgroundColor: t.colors.champagne || '#fff', padding: 12, borderRadius: 12, marginBottom: 10, color: t.colors.text },
  row: { flexDirection: 'row', alignItems: 'center' },
  spaceSmall: { height: 10 },
  pillContainer: { flexDirection: 'row', backgroundColor: 'transparent', borderRadius: 24, padding: 6 },
  pill: { paddingVertical: 8, paddingHorizontal: 16, borderRadius: 20, marginRight: 8, borderWidth: 1, borderColor: 'transparent' },
  pillText: { fontWeight: '700' },
  button: { backgroundColor: t.colors.primary, paddingVertical: 12, paddingHorizontal: 18, borderRadius: 12, alignItems: 'center', justifyContent: 'center' },
  secondaryButton: { backgroundColor: 'transparent', borderWidth: 1, borderColor: t.colors.primary, paddingVertical: 10, paddingHorizontal: 16, borderRadius: 12, alignItems: 'center' },
  buttonText: { color: '#fff', fontWeight: '700' },
  buttonTextMuted: { color: t.colors.primary, fontWeight: '700' },
  avatar: { width: 48, height: 48, borderRadius: 12, backgroundColor: t.colors.muted, marginRight: 12 },
  separator: { height: 1, backgroundColor: '#eef3f6', marginVertical: 12 }
});

// Theme context and provider
const defaultTheme = {
  colors,
  spacing: { container: 16, card: 12 }
};

const ThemeContext = createContext({ theme: defaultTheme, setTheme: () => {} });

export function ThemeProvider({ children, initialTheme }) {
  const [theme, setTheme] = useState(initialTheme || defaultTheme);
  const value = useMemo(() => ({ theme, setTheme }), [theme]);
  return (
    <ThemeContext.Provider value={value}>{children}</ThemeContext.Provider>
  );
}

export function useTheme() {
  const ctx = useContext(ThemeContext);
  return ctx ? ctx.theme : defaultTheme;
}

export function useThemedStyles() {
  const theme = useTheme();
  const s = useMemo(() => buildGlobal(theme), [theme]);
  return { s, theme };
}

// backward-compatible global and PillToggle for existing imports
export const global = buildGlobal(defaultTheme);

export function PillToggle({ options = [], value, onChange }) {
  return (
    <View style={global.pillContainer}>
      {options.map(opt => (
        <TouchableOpacity
          key={opt.value}
          onPress={() => onChange(opt.value)}
          style={[global.pill, { backgroundColor: value === opt.value ? colors.primary : 'transparent' }]}
        >
          <Text style={[global.pillText, { color: value === opt.value ? '#fff' : colors.primary }]}>{opt.label}</Text>
        </TouchableOpacity>
      ))}
    </View>
  );
}

// default export
export default { colors, buildGlobal, ThemeProvider, useTheme, useThemedStyles, global, PillToggle };
